// 过滤没有权限的菜单
function filterTree(tree, condition, childFieldName, type, isChild) {
  const filteredTree = [];
  // 遍历树的每个节点
  for (const node of tree) {
    const children = filterTree(node[childFieldName] || [], condition, childFieldName, type, true);
    children.sort((a, b) => b.code - a.code);
    // const children = filterTree(node[childFieldName] || [], condition).sort((a,b)=>b.code-a.code,childFieldName,type,type ) // 暂时没有返回排序字段
    const filteredNode = {
      ...node,
      children: children, // 修复这里，递归调用 filterTree 函数并将结果赋值给子节点
    };
    delete filteredNode[childFieldName];
    const data = condition(filteredNode, type);
    if (data) {
      // 角色权限有问题 暂时过滤第一层没有子集菜单的。
      if(isChild || (!isChild && children?.length >0 )){
        filteredTree.push({...filteredNode,...data});
      }
    }
  }
  return filteredTree;
}

const condition = (node, type) => {
  return menuObj[type].find((menu)=>menu.path ===node.path)
}
/**
 * 
 * @param {*} menuAuthList tree
 * @param {*} childFieldName children:name
 * @returns 
 */
export const getMenus = (menuAuthList=[], childFieldName= 'children', type)=>{
  console.log('-------menuAuthListmenuAuthListmenuAuthList------->',menuAuthList)
  let menus = [];
  if(menuAuthList && menuAuthList.length > 0){
    const menu = menuAuthList.find((item)=>item.path === type);
    //存在菜单
    const children = menu ? menu[childFieldName] :undefined;
    if(children){
      menus = filterTree(children, condition, childFieldName, type);
    }
  }
  return menus;
}
